import React from "react";
import { Button } from 'reactstrap';
import './styles/SingleReport.css'

function SignleReport({ id, state, reportType, payload, reps, setReps }) {

    function deleteHandler(event) {
        console.log(event);
    }

    return <div>
        <tr>
            <td>ID: {id}</td>
        </tr>
        <tr>
            <td>State: {state}</td>
        </tr>
        <tr>
            <td>Type: {reportType}</td>
        </tr>
        <tr>
            <td>Message: {payload}</td>
        </tr>


        <Button  color="primary">Resolve</Button>

        <Button onClick={deleteHandler} color="danger">Block</Button>

    </div>
}

export default SignleReport;
